import React from "react";
import Navbar from "./components/Navbar";
import UserSetup from "./components/UserSetup";
import HangmanLogic from "./components/HangmanLogic";
import Footer from "./components/Footer";

import { useState } from "react";
import { useSelector, useDispach } from "react-redux";
import { bindActionCreators } from "redux";
import { actionCreators } from "./state/action-creators";

function App() {
  const [name, setName] = useState(false);
  const player = useSelector((state) => state.player);
  const dispatch = useDispach();
  const { setUsername, resetUser } = bindActionCreators(
    actionCreators,
    dispatch
  );

  return (
    <div className="bg-black text-white h-screen w-full">
      {!name && <UserSetup />}
      {name && (
        <div>
          <Navbar />
          <HangmanLogic />
          <Footer />
        </div>
      )}
    </div>
  );
}

export default App;
